import { Swiper, SwiperSlide } from "swiper/react";

import './style.css'
import 'swiper/css';

const KnowLedge = () => {
    const knowledgeList = [
        {
            title: 'Java',
            logo: 'java-logo.png'
        },
        {
            title: 'JavaScript',
            logo: 'js-logo.png'
        },
        {
            title: 'Git',
            logo: 'git-logo.png'
        },
        {
            title: 'NodeJS',
            logo: 'nodejs.png'
        },
        {
            title: 'Spring',
            logo: 'spring-logo.png'
        },
        {
            title: 'React JS',
            logo: 'react-logo.png'
        },
        {
            title: 'MySQL',
            logo: 'mysql-logo.png'
        },
    ]

    return (
        <section id='knowledge'>
            <div id='text-side'>
                <h2>Conhecimento</h2>
                <span>Isso Ã© um pouco do que eu sei</span>
            </div>
            <Swiper
                spaceBetween={50}
                slidesPerView={3}
                onSlideChange={() => console.log('slide change')}
                onSwiper={(swiper) => console.log(swiper)}
                id='logos-side'
            >
                {knowledgeList.map(item => (
                    <SwiperSlide className='knowledge-item'>
                        <img src={`/images/logos/${item.logo}`} alt={`${item.title} logo`} />
                        <span>{item.title}</span>
                    </SwiperSlide>
                ))}
            </Swiper>
        </section>
    )
}


export default KnowLedge
